import React from 'react'
import { Alert, Button, StyleSheet, View } from 'react-native';

const MyButton = () => {
    return (
        <View style={styles.container}>
        <View style={styles.buttonContainer}>
          <Button
            onPress={this._onPressButton}
            title="Press Me"
          />
        </View>
        </View>
    )
}

export default MyButton
